export function filtromenos(a, b) {
  let c = Number(a.poblacion.replace(/[.]/g, ""));
  let d = Number(b.poblacion.replace(/[.]/g, ""));

  if (c === d) {
    return 0;
  }
  if (c < d) {
    return -1;
  }
  return 1;
}

export function filtromas(a, b) {
  let c = Number(a.poblacion.replace(/[.]/g, ""));
  let d = Number(b.poblacion.replace(/[.]/g, ""));

  if (c === d) {
    return 0;
  }
  if (c > d) {
    return -1;
  }
  return 1;
}

export function organizar(pais) {
  const ascen = pais.sort(function (a, b) {
    if (a.name === b.name) {
      return 0;
    }
    if (a.name < b.name) {
      return -1;
    }
    return 1;
  });

  return ascen;
}
